import React from 'react';
import ReactDOM from 'react-dom';
import "./sass/stockbar2.css";
import "./css/customCSS.css";

export default class Stockbar2 extends React.Component {
    state = {
        loading: true
    }

    async componentDidMount() {
        const stockAPIURL = `https://financialmodelingprep.com/api/v3/available-traded/list?apikey=7e60778244bbb11a3e59192e565ed625?limit=100`;
        const response = await fetch(stockAPIURL);
        const data = await response.json();
        data.splice(100);

        console.log(data);
    }

    render() {
        return (
            <div className={this.state.loading}></div>
        )
    }
}
